    false,nt"url": null,nt"notes": "This Comprehensive Conservation Plan (CCP)
    was written to guide management on Lee Metcalf NWR for the next 15 years. This plan
    outlines the Refuge vision and purpose and describes how Lee Metcalf NWR will contribute
    to the overall mission of the Refuge System. The plan provides an introduction to
    the Refuge, an overview of the CCP process, a summary of Refuge resources, and information
    about the management direction. Key planning issues include: wetland management,
    water, invasive species, and monitoring.",nt"license_title": "License Not
